import React from "react";
import Dog from "react-svg-loader!../../public/scene.svg";

const Header = () => {
  return (
    <div className="header">
      <h1>
        adoptuj<span>zwierzaka</span>.pl
      </h1>
      <div className="wrapper">
        <Dog />
      </div>

      <style jsx>
        {`
          .header {
            background: rgb(170, 209, 93);
            background: linear-gradient(
              74deg,
              rgba(170, 209, 93, 1) 0%,
              rgba(109, 190, 69, 1) 81%,
              rgba(7, 153, 72, 1) 100%
            );
          }

          h1 {
            font-size: 40px;
          }

          h1 span {
            color: var(--main-color);
          }

          svg {
            width: 200px;
          }
        `}
      </style>
    </div>
  );
};

export default Header;
